import React from 'react';
import Header from './Components/Header/';
import { Grid } from '@material-ui/core';

function App() {
  return (
    <Grid container>
      <Grid item md={12}>
        <Header children={'asdad'} />
      </Grid>
    </Grid>
  );
}

export default App;
